  `arenaDefFormation` varchar(255) DEFAULT NULL,
  `robDomainAttFormation` varchar(255) DEFAULT NULL,
  `robDomainDefFormation` varchar(255) DEFAULT NULL,
  `towerFormation` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
